　・効きめが見えて使いやすい<br>
　新開発の透明樹脂ボトルを採用。薬剤の残量が<br>
　見えるので、取替え時期がひと目で分かります。<br>
・ワンプッシュで速効＆24時間効果<br>
　1回押すだけで薬剤が瞬時に広がり、すばやい効果<br>
　を発揮。小さくて軽い粒子が長く空間に漂い、<br>
　床や壁についた蒸散性の高い薬剤が再蒸散すること<br>
　で、優れた効果が24時間続きます。（侵入防止効果）<br>
・家中で使える<br>
　1回のプッシュで効果が長時間続くので、部屋に<br>
　ずっと置いておく必要がありません。家中で使えて<br>
　便利です。 <br>
・ロマンティックブーケの香り<br>
　華やかなローズ、マグノリアなどのフローラルに<br>
　マンダリンオレンジなどのみずみずしいフルーツ<br>
　をミックスした透明感溢れるフローラルブーケの<br>
　香りです。<br>
・ロック機能で誤作動を防止<br>
　押しても噴射しないので、お子様のイタズラを防止<br>
　できます。
