虫よけ対策！・効力が大幅にアップ<br>
　　薬剤の含浸量を高めた新開発の薬剤カート<br>
　　リッジと、薬剤を効率よく拡散するファンの<br>
　　力で屋外用電池式5個分の効力を実現。<br>　　　  （当社従来品比較） 屋外でも約98％の<br>
    虫よけ効果を発揮します。<br><br>
・取替えは一度でカンタン<br>
　　電池の切れた時が薬剤の取替えどきなので、<br>
　　交換が一度で済みます。カートリッジの装着も<br>
　　ワンタッチで簡単です。<br><br>
・機能的でスタイリッシュなデザイン<br>
　　コンパクトサイズなので携帯しても邪魔に<br>
　　なりません。底面がフラットなので室内で<br>
　　置いて使うこともできます。吸気部分の<br>
　　デザインは、ピンクは可愛らしい印象の<br>
　　ドット、ブルーはシャープなストライプで<br>
　　スタイリッシュに仕上げました。存在感の<br>
　　ある鮮やかなカラーも魅力です。<br><br>
・480時間効果が続く<br>
　　ムダなく薬剤を拡散させる高性能ファンの<br>
　　働きにより、たっぷり480時間も効果が<br>
　　持続します。
<br> <br>  
※注　<br>  
